import MoviesCard from "../MoviesCard/MoviesCard";

function MoviesCardList({movies}) {

    return (
        <section className="moviesCardList">
            {movies.map((movie) => (
                <MoviesCard key={movie.id} movie={movie}/>
            ))}
        </section>
    );
}

export default MoviesCardList;
